INSERT INTO `hotels` VALUES ('00d60e60-d366-4d73-b3c0-614ecb95feb7',_binary '\0','2025-09-28 14:20:27.319698','Dù bạn đang lên kế hoạch cho một sự kiện hay những dịp đặc biệt khác, Hoang Ngoc Beach Resort là một lựa chọn tuyệt vời dành cho bạn với một phòng chức năng lớn và được trang bị đầy đủ để đáp ứng các yêu cầu của bạn.',0,0,'Hoang Ngoc Beach Resort',5,'active','2025-10-14 16:05:49.539431','5d73427e-9c3b-11f0-a7b7-0a6aab4924ab','b97ecc88-9c3b-11f0-a7b7-0a6aab4924ab','853a1d78-2ebb-4eee-96cd-957878ec4524','152','b718319a-6fce-4a35-81af-d71caba4a916','29966eb1-9c3b-11f0-a7b7-0a6aab4924ab','032f0393-9c3c-11f0-a7b7-0a6aab4924ab','d7ab9dcb-9c3b-11f0-a7b7-0a6aab4924ab',15),('04a97b2a-1564-480a-a6c9-eb94dbc78dd4',_binary '\0','2025-09-27 02:33:55.439424','Tọa lạc gần sân bay, Orchide\'es Ocean Hotel là nơi nghỉ ngơi lý tưởng trong lúc quý khách đang chờ chuyến bay kế tiếp. Quý khách có thể tận hưởng không gian nghỉ dưỡng vừa ý nơi đây trong quá trình quá cảnh.\n\nOrchide\'es Ocean Hotel là đề xuất hàng đầu dành cho những tín đồ du lịch \"bụi\" mong muốn được nghỉ tại một khách sạn vừa thoải mái lại hợp túi tiền.\n\nDành cho những du khách muốn du lịch thoải mái cùng ngân sách tiết kiệm, Orchide\'es Ocean Hotel sẽ là lựa chọn lưu trú hoàn hảo, nơi cung cấp các tiện nghi chất lượng và dịch vụ tuyệt vời.\n\nTừ sự kiện doanh nghiệp đến họp mặt công ty, Orchide\'es Ocean Hotel cung cấp đầy đủ các dịch vụ và tiện nghi đáp ứng mọi nhu cầu của quý khách và đồng nghiệp.\n\nHãy tận hưởng thời gian vui vẻ cùng cả gia đình với hàng loạt tiện nghi giải trí tại Orchide\'es Ocean Hotel, một khách sạn tuyệt vời phù hợp cho mọi kỳ nghỉ bên người thân.\n\nKhách sạn này là lựa chọn hoàn hảo cho các kỳ nghỉ mát lãng mạn hay tuần trăng mật của các cặp đôi. Quý khách hãy tận hưởng những đêm đáng nhớ nhất cùng người thương của mình tại Orchide\'es Ocean Hotel\n\nNếu dự định có một kỳ nghỉ dài, thì Orchide\'es Ocean Hotel chính là lựa chọn dành cho quý khách. Với đầy đủ tiện nghi với chất lượng dịch vụ tuyệt vời, Orchide\'es Ocean Hotel sẽ khiến quý khách cảm thấy thoải mái như đang ở nhà vậy.\n\nBạn có phải là tín đồ mua sắm? Lưu trú tại Orchide\'es Ocean Hotel chắc chắn sẽ thoả mãn bạn với hàng loạt các trung tâm mua sắm kề cận.\n\nDu lịch một mình cũng không hề kém phần thú vị và Orchide\'es Ocean Hotel là nơi thích hợp dành riêng cho những ai đề cao sự riêng tư trong kỳ lưu trú.\n\nDịch vụ tuyệt vời, cơ sở vật chất hoàn chỉnh và các tiện nghi khách sạn cung cấp sẽ khiến quý khách không thể phàn nàn trong suốt kỳ lưu trú tại Orchide\'es Ocean Hotel.\n\nQuầy tiếp tân 24 giờ luôn sẵn sàng phục vụ quý khách từ thủ tục nhận phòng đến trả phòng hay bất kỳ yêu cầu nào. Nếu cần giúp đỡ xin hãy liên hệ đội ngũ tiếp tân, chúng tôi luôn sẵn sàng hỗ trợ quý khách.\n\nTận hưởng những món ăn yêu thích với phong cách ẩm thực đặc biệt từ Orchide\'es Ocean Hotel chỉ dành riêng cho quý khách.\n\nSóng WiFi phủ khắp các khu vực chung của khách sạn cho phép quý khách luôn kết nối với gia đình và bè bạn.\n\nOrchide\'es Ocean Hotel là khách sạn sở hữu đầy đủ tiện nghi và dịch vụ xuất sắc theo nhận định của hầu hết khách lưu trú.\n\nVới những tiện nghi sẵn có Orchide\'es Ocean Hotel thực sự là một nơi lưu trú hoàn hảo.',0,0,'Orchide\'es Ocean Hotel',3,'active','2025-10-02 17:39:20.111902','b491043b-97ce-11f0-a7b7-0a6aab4924ab','9d0e4548-97d2-11f0-a7b7-0a6aab4924ab','4c963c30-3496-43c3-85a6-004f99e7ea07','9','b718319a-6fce-4a35-81af-d71caba4a916','1fe5846e-931a-440a-9e88-ffe6896df192','66851f55-988c-11f0-a7b7-0a6aab4924ab','04c72f84-97d4-11f0-a7b7-0a6aab4924ab',15),('07815e33-80c7-4d5c-8d19-e9e49ae9283b',_binary '\0','2025-09-28 14:56:38.243244','Nhà khách Diem Lien là đề xuất hàng đầu dành cho những tín đồ du lịch \"bụi\" mong muốn được nghỉ tại một khách sạn vừa thoải mái lại hợp túi tiền.\n\nDành cho những du khách muốn du lịch thoải mái cùng ngân sách tiết kiệm, Nhà khách Diem Lien sẽ là lựa chọn lưu trú hoàn hảo, nơi cung cấp các tiện nghi chất lượng và dịch vụ tuyệt vời.\n\nNếu dự định có một kỳ nghỉ dài, thì Nhà khách Diem Lien chính là lựa chọn dành cho quý khách. Với đầy đủ tiện nghi với chất lượng dịch vụ tuyệt vời, Nhà khách Diem Lien sẽ khiến quý khách cảm thấy thoải mái như đang ở nhà vậy.\n\nDu lịch một mình cũng không hề kém phần thú vị và Nhà khách Diem Lien là nơi thích hợp dành riêng cho những ai đề cao sự riêng tư trong kỳ lưu trú.\n\nNhà khách Diem Lien là lựa chọn đúng đắn cho những ai đang tìm kiếm các khách sạn hợp với túi tiền tại Hàm Tiến.\n\nQuầy tiếp tân 24 giờ luôn sẵn sàng phục vụ quý khách từ thủ tục nhận phòng đến trả phòng hay bất kỳ yêu cầu nào. Nếu cần giúp đỡ xin hãy liên hệ đội ngũ tiếp tân, chúng tôi luôn sẵn sàng hỗ trợ quý khách.\n\nNhà khách Diem Lien là khách sạn sở hữu đầy đủ tiện nghi và dịch vụ xuất sắc theo nhận định của hầu hết khách lưu trú.\n\nNhà khách Diem Lien là lựa chọn sáng suốt dành cho những du khách ghé thăm Hàm Tiến.',0,0,'Diem Lien Guesthouse',3,'active','2025-10-02 17:39:26.016290','5d73427e-9c3b-11f0-a7b7-0a6aab4924ab','b97ecc88-9c3b-11f0-a7b7-0a6aab4924ab','f12f43d5-4359-4619-8288-78c8730b9e7b','85','b718319a-6fce-4a35-81af-d71caba4a916','29966eb1-9c3b-11f0-a7b7-0a6aab4924ab','032f50d9-9c3c-11f0-a7b7-0a6aab4924ab','d7ab9dcb-9c3b-11f0-a7b7-0a6aab4924ab',15),('0ceaf0e4-9cc5-400f-967a-08f9f960d832',_binary '\0','2025-09-28 13:27:25.712677','Dù quý khách muốn tổ chức một sự kiện hay các dịp kỷ niệm đặc biệt khác, Comodo Nha Trang Hotel là lựa chọn tuyệt vời cho quý khách với phòng chức năng rộng lớn, được trang bị đầy đủ để sẵn sàng đáp ứng mọi yêu cầu.\n\nKhách sạn này là lựa chọn hoàn hảo cho các kỳ nghỉ mát lãng mạn hay tuần trăng mật của các cặp đôi. Quý khách hãy tận hưởng những đêm đáng nhớ nhất cùng người thương của mình tại Comodo Nha Trang Hotel\n\nComodo Nha Trang Hotel là lựa chọn sáng giá dành cho những ai đang tìm kiếm một trải nghiệm xa hoa đầy thú vị trong kỳ nghỉ của mình. Lưu trú tại đây cũng là cách để quý khách chiều chuộng bản thân với những dịch vụ xuất sắc nhất và khiến kỳ nghỉ của mình trở nên thật đáng nhớ.\n\nTừ sự kiện doanh nghiệp đến họp mặt công ty, Comodo Nha Trang Hotel cung cấp đầy đủ các dịch vụ và tiện nghi đáp ứng mọi nhu cầu của quý khách và đồng nghiệp.\n\nHãy tận hưởng thời gian vui vẻ cùng cả gia đình với hàng loạt tiện nghi giải trí tại Comodo Nha Trang Hotel, một khách sạn tuyệt vời phù hợp cho mọi kỳ nghỉ bên người thân.\n\nNếu dự định có một kỳ nghỉ dài, thì Comodo Nha Trang Hotel chính là lựa chọn dành cho quý khách. Với đầy đủ tiện nghi với chất lượng dịch vụ tuyệt vời, Comodo Nha Trang Hotel sẽ khiến quý khách cảm thấy thoải mái như đang ở nhà vậy.\n\nDu lịch một mình cũng không hề kém phần thú vị và Comodo Nha Trang Hotel là nơi thích hợp dành riêng cho những ai đề cao sự riêng tư trong kỳ lưu trú.\n\nDịch vụ thượng hạng song hành với hàng loạt tiện nghi phong phú sẽ đem đến cho quý khách trải nghiệm của một kỳ nghỉ viên mãn nhất.\n\nHưởng thụ một ngày thư thái đầy thú vị tại hồ bơi dù quý khách đang du lịch một mình hay cùng người thân.\n\nNhận ưu đãi đặc biệt dành cho các liệu pháp spa tinh tuý nhất giúp thư giãn tinh thần và làm tươi trẻ cơ thể.\n\nQuầy tiếp tân 24 giờ luôn sẵn sàng phục vụ quý khách từ thủ tục nhận phòng đến trả phòng hay bất kỳ yêu cầu nào. Nếu cần giúp đỡ xin hãy liên hệ đội ngũ tiếp tân, chúng tôi luôn sẵn sàng hỗ trợ quý khách.\n\nTận hưởng những món ăn yêu thích với phong cách ẩm thực đặc biệt từ Comodo Nha Trang Hotel chỉ dành riêng cho quý khách.\n\nSóng WiFi phủ khắp các khu vực chung của khách sạn cho phép quý khách luôn kết nối với gia đình và bè bạn.\n\nComodo Nha Trang Hotel là khách sạn sở hữu đầy đủ tiện nghi và dịch vụ xuất sắc theo nhận định của hầu hết khách lưu trú.\n\nTận hưởng trải nghiệm lưu trú xa hoa đầy thú vị không đâu sánh bằng tại Comodo Nha Trang Hotel.',0,0,'Khách sạn Comodo Nha Trang',3,'active','2025-10-02 17:39:33.919838','f5af1aa8-9c38-11f0-a7b7-0a6aab4924ab','3edb5675-9c39-11f0-a7b7-0a6aab4924ab','35b546aa-09bf-40eb-bd9e-81e9beb9ffec','